window.bookSummaryJSON = "<p><b>Chosen. Liberator. Queen</b></p> <p>Reeling after the battle of Black Court, Saraya must come to terms with the decision she has made.</p> <p>The Green Reaper is still out there with all his cunning and will stop at nothing to destroy everything she holds dear. All Saraya has is her mother's frantic instructions and her own sheer strength of will.</p> <p>She must win Lobrathia back at all costs, or the entire human realm will fall.</p> <p>But at what cost?</p> <p>Join Saraya and Drake on their epic romantic adventure in the final installment of The Warrior Midwife Trilogy. Intended for mature listeners.</p>"; 
